import React from "react";
// importing App.js variables.
export default function Main({page}){
    function renderPage(){
        switch (page){
            case("about"):
            return (
                <div>a</div>
            ) 
            case("portfolio"):
            return (
                <div>p</div>
            )
            case("resume"):
            return (
                <div>r</div>
            )
            case("contact"):
            return (
                // email form, message
                
                <div></div>
            )
            
        }
    }
    return(
        <div className="header">
       {renderPage()}
        </div>
    );


}
